import React from 'react'
import PropTypes from 'prop-types'
import { withRouter } from 'react-router'

import Garment from 'components/Garment'
import AddGarmentToOutfitForm from './AddGarmentToOutfitForm'

export class CapsuleAccordionGarment extends React.Component {
  static propTypes = {
    capsuleID: PropTypes.string,
    garment: PropTypes.object,
    image: PropTypes.object,
    handleAdd: PropTypes.func
  }

  render () {
    return (
      <div className='col-xs-12 col-sm-6 col-md-6 col-lg-6'>
        <Garment
          garment={this.props.garment}
          image={this.props.image}>
          <AddGarmentToOutfitForm
            capsuleID={this.props.match.params.id}
            garmentID={this.props.garment.id}
            onClick={this.props.handleAdd} />
        </Garment>
      </div>
    )
  }
}

export default withRouter(CapsuleAccordionGarment)
